configure:
  commands:
    50 permit tcp host 1.1.1.1 eq 2001 host 2.2.2.2 eq 80 reflect R10000 timeout 120: "50\
      \ permit tcp host 1.1.1.1 eq 2001 host 2.2.2.2 eq 80 reflect R10000 timeout\
      \ 120\r\n"
    end:
      new_state: execute
    ip access-list extended test2: "ip access-list extended test2\r\n"
    line console 0:
      new_state: configure_line
    no logging console: ''
  prompt: Cat9600-SVL_CGW(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: Cat9600-SVL_CGW(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: Cat9600-SVL_CGW#
